import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import GroupStage from './pages/GroupStage'; // Exemple de page
import HomePage from './pages/HomePage'; // Une page d'accueil (peut-être que tu as une page d'accueil à afficher)

function App() {
    return (
        <Router>
            <Routes>
                {/* Route pour la page d'accueil */}
                <Route path="/" element={<HomePage />} />

                {/* Exemple de route vers d'autres pages */}
                <Route path="/classement" element={<GroupStage />} />
                {/* Ajouter d'autres routes */}
            </Routes>
        </Router>
    );
}

export default App;
